import React from 'react';

import NewsSlider from '../../../widgets/NewsSlider/slider';
import NewsList   from '../../../widgets/NewsList/newsList';

const NewsMain = () => {
    return(
        <div>
            <NewsSlider
                type="featured"
                country={'ca'}
                city={''}
                category={'health'}
                amount={5}
                setting={{
                    dots:false
                }}
            />
        </div>
    )
}

export default NewsMain;
